import React from 'react';
import styles from './LastVisit.css';

const LastVisit = () => {
  return (
    <>
    <h2>Based on your last visit</h2>
    <div className='container__lv'>
      <div className="item1__lv">
        <div className="card">
          <div className="cover"></div>
          <div className="info"><p>Ford Focus III 2.0 Se</p></div>
        </div>
      </div>
      <div className="item2__lv"></div>
      <div className="item3__lv"></div>
      <div className="item4__lv"></div>
    </div>
    </>
  )
}

export default LastVisit;
